1. Carla le yaʋalagbalẽ si kpẽ Go 200 la hem. means Carla spent 200 euros.
2. Nuhehea ƒe ablaɖeɖe nye Go 20 le miniti ɖeka me; esi wohe nua va ɖo 40% la, means In the first 20 minutes, 40% of the time was spent;
3. Windows ɖe asi te na nua alebe woagbugbɔ asi eɖokui hena nuyeyeawo dede tome, eye esia xɔ miniti 20 sɔŋ. means Windows took 20 minutes to complete the task;
4. Esia wɔ be, Carla nagbugbɔ adze nuhehea gɔme tso gɔmedzedzea ke. means Therefore, Carla spent the remaining time from the total time.
5. Ɣeyiɣi nenie hiã hena agbalẽ hehe mahã? means How long did she spend?

